import React from "react";
import "./App.scss";
import title from "../images/new-logo-ngang.png";

class App extends React.Component {
  render() {
    return (
      <header className="header">
        <div className="title">
          <img src={title} alt="Title Rick And Morty" />
        </div>
      </header>
    );
  }
}

export default App;
